  false,\n\t\"url\": null,\n\t\"notes\": \"The sediments on the shelf off Palos Verdes
  CA are contaminated with large amounts of DDT. Moorings were deployed on the shelf
  in the winter of 1993 in part to determine how often coastal ocean processes move
  these sediments. This program was supported by the EPA in order to gather information
  that would help them determine the best way to remediate the contamination on this
  local continental shelf.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
